- proto: BookRandom
  entities:
  - uid: 24809
    components:
    - type: MetaData
      name: An account of the strange origins of Court station
    - type: Transform
      pos: 27.457674,34.705173
      parent: 2
    - type: Paper
      content: >+
        This book details the long and fantastic history of the station known today as NT14 Court, which started out as the most daring project of its era.


        Drafted by Donk.co in 2908, the station plans envisioned a grand space mall that would have attracted denizens of planets from all over the sector. 

        Sporting multiple docking arms, a powerful and extremely modern (for its time) singularity engine, grand gardened hallways with real plants and insects and multiple sections dedicated to all types of stores, it was to be the gleaming space jewel of the Donk corporation.


        Unfortunately for the consumers of the sector, however, the project proved much harder to complete than first imagined. 


        Starting with 2910 when the project had barely started, the excavation team, mining the anchor asteroid for resources, came upon an old temple filled with space carp and containing multiple treasures. This attracted the attention of space pirates, and in 2912, taking advantage of some contract disputes between Donk.co and its security detail, two pirate shuttles attacked the station as it had been left undefended, breaching the atmosphere on multiple levels and sacking it for most of its riches.


        Donk.co eventually scrapped the project after multiple failed attempts at recovery and many complaints from its investors, leaving the station unsold and unmanned for decades, during which time many space drifters, wildlife and squatters used it as shelter; during this era, a small group of people decided to rebuild the station and make it their own, a space home for those who had been ostracized, were outlaws or simply had nowhere else to go. They reportedly used the unfinished gardens to grow food and wood, mining a significant portion of the remaining asteroid for materials as well as to trade for other supplies.


        In the following years, the station went through gradual changes and was eventually sold to Interdyne for a fraction of its cost of construction. The pharmaceuticals corporation used it as a research outpost, negotiating with the locals for security, supplies and maintenance as well as occasional test subjects.


        This new arrangement lasted for some time, but ended abruptly when an incident involving a virus going out of control wiped out most of the station's population.


        After the next few decades and many meteor showers, very few things remained of the original design; the mall's food court, however, had miraculously been spared from most of the damage.


        When NanoTrasen acquired the station after settling a dispute with Cybersun for territory control, the board of representatives decided to restore the derelict scrap heap to its long dreamed-of glory, making it a glorious addition to the rising corporation's many new assets and dubbing it Court Station in reference to the last surviving echo of Donk.co's failure.


        Today, Court station serves as a functional (if a little dense) research, trading and production outpost for NanoTrasen, capable of supporting a full shift's worth of crew. It won the "cozy" award in NT's 2981 station awards event, and occasionally attracts tourists for its rich and intriguing history.


