        Just in case you want to do it without me or I can't make it to next shift, here are some key points to keep in mind:


        - if the APC turns off, all settings on the machine will be set to the wrong values, and it will begin losing integrity. So keep a backup generator in here if possible! And make sure to restore the settings to appropriate values when power comes back.


        - you can restore machine integrity by pumping healium into the moderator mix!


        - the machine loses integrity on high fusion levels, and restores integrity on the lower ones.


        - you can use frezon in the moderator mix to lower the temperature and radiation output, so I suggest making some beforehand!


        - BZ is extremely useful for the creation of gases in this device, so make some if you can, or look around, I think Sarah stashed a can somewhere.


        - if integrity starts going too low and you don't know what to do, put the heating conductor and gas injection settings to minimum, and fiddle with the magnetic constrictor to make the heat output negative. If you can't manage it, then just pump more gas into the moderator mix, since that will cool things down!
