        [head=3][head=2]1. [/head]The Parties[/head]

        This Construction Contract, hereinafter known as the "Contract," is created between
            [color=#002AAF]NanoTrasen[/color]
          
        hereinafter known as the "Client," and
            [color=#002AAF]SaibaSan Steel works Co.[/color]
          
