        [head=3][head=2]2. [/head]Description of Work[/head]

        The Client requires and expects the Contractor to complete the following: (the "Work")

        \[  ] Repairs

        Detail:  [color=#002AAF]Sample[/color]
          
        \[X] Expansion

        Detail:  [color=#002AAF]Building a life-sized chess board complete with pieces and the correct number of tiles and colour placement. Spectator benches will be built on the side of the board. Around the board will be built a room with appropriate atmosphere and lighting, with windows facing space and a disposal chute next to the viewing benches. Any walls facing space will be made up of a plasteel alloy and must be certified space dust resistant.[/color]
          
        \[  ] Upgrades

        Detail:  [color=#002AAF]Sample[/color]
          
        \[  ] Other

        Detail:  [color=#002AAF]Sample[/color]
          
        Additional Information/Requests:

        NanoTrasen provides all plasma required for plasteel production, at no cost, in return for guarantee of finished work.



        [head=3][head=2]3. [/head]Payment for Work[/head]

        The Client agrees to pay the Contractor the following:


        [color=#002AAF]24,999.99 Spesos[/color]

          Deposited immediately, and

        [color=#002AAF]9,999.99 Spesos and three life-sized Honk Mother statues made of a no less than 50% bananium bananium-gold alloy [/color]

          Upon completion of Work

        Payment of this amount is subject to change in accordance with mutually agreed changes/modifications to the Work.


        [head=3][head=2]4. [/head]Certificate of Completion[/head]

        Work under this agreement shall begin immediately. Upon completion of the Work, the Contractor shall notify the Client that the Work is ready for final inspection and acceptance. The Client shall make payment before  next quarter unless another payment arrangement has been made.


        [head=3][head=2]5. [/head]Materials & Labor[/head]

        Material acquisition payment is the responsibility of:

        (  ) The Contractor

        (  ) The Client

        (X) Handled on a case-by-case basis by the Parties


        Provision of labor is the responsibility of:

        (X) The Contractor

        (  ) The Client

        (  ) Handled on a case-by-case basis


        (if provision of materials and/or labor is the responsibility of the Contractor) The cost of materials/labor:

